import React from "react";
import Comment from "./Comment";
import Todo from "./Todo";

const TodoList = ({ todos }) => {
  return (
    <>
      <div>{todos.ischecked ? "체크됨" : "체크안됨"}</div>
      {todos.map((item) => {
        return <div>{item.text}</div>;
      })}

      {/* <Todo />
      <Comment /> */}
    </>
  );
};

export default TodoList;
